package com.ho.aug104springdi.kimsumi;

public class Kimsumi {
	private String name;
	private int age;
	
	public Kimsumi() {
		// TODO Auto-generated constructor stub
	}

	public Kimsumi(String name, int age) {
		super();
		this.name = name;
		this.age = age;
	}

	public String getName() {
		return name;
	}

	public void setName(String name) {
		this.name = name;
	}

	public int getAge() {
		return age;
	}

	public void setAge(int age) {
		this.age = age;
	}
	
}
